import React, { Component } from 'react';

export default class One extends Component {

    constructor(props) {
        super(props);

        this.updatePoints = this.updatePoints.bind(this);
    }

    handleClick() {
        this.updatePoints = this.updatePoints.bind(this);
    }

    render () {
        return (
        <div className="One">
            <button>Change Background Color</button>
        </div>
        )
    }
}
